import { authHeader } from 'App/authentication/authHeader';
import { handleResponse } from 'App/authentication/handleResponse';

export const userService = {
	getUser
};

function getUser() {
    const requestOptions = {method:'GET', headers: authHeader()};
    return fetch(`/user/`, requestOptions).then(handleResponse);
}
